import React, { Component } from 'react'

import api from './Api'
import Card from './components/Card';
import './styles/App.css';

class App extends Component {
  state = {
    weather: [],
  };

  async componentDidCatch() {
    const resp = await api.get('Sorocaba');
    this.setState()
  }
}

export default App;
